actionConfiguration.body:
async () => {
		if (tblJobOrderList.selectedRow.jobResponseId == "") {
			await AddJobResponse.run()
		}
		return ActivateJobOrder.run()
		.then(()=>{
			if (ActivateJobOrder.data.errors != null) {
				showAlert(ActivateJobOrder.data.errors[0].message)
			} else {
				closeModal("modalSelectJobOrder")
			}
		})
		return
	}

